const Login = ({ isUserAuthenticated }) => {
    const [login, setLogin] = useState(loginInitialValues);
    const [signup, setSignup] = useState(signupInitialValues);
    const [error, showError] = useState('');
    const [success, showSuccess] = useState('');
    const [account, toggleAccount] = useState('login');
    const [showPassword, setShowPassword] = useState(false);
  
    const navigate = useNavigate();
    const { setAccount } = useContext(DataContext);
  
    useEffect(() => {
      showError('');
      showSuccess('');
    }, [login, signup]);
  
    const onLoginValueChange = (e) => {
      setLogin({ ...login, [e.target.name]: e.target.value });
    };
  
    const onSignupInputChange = (e) => {
      setSignup({ ...signup, [e.target.name]: e.target.value });
    };
  
    // Rest of the component remains the same
  
    return (
      <Component>
        <Box>
          <Image src={imageURL} alt="login" style={{ verticalAlign: 'top' }} />
          {account === 'login' ? (
            <Wrapper>
              <TextField
                variant="standard"
                value={login.username}
                onChange={onLoginValueChange}
                name='username'
                label='Enter Username'
              />
              <TextField
                variant="standard"
                value={login.password}
                onChange={onLoginValueChange}
                name='password'
                label='Enter Password'
                type={showPassword ? 'text' : 'password'}
                InputProps={{
                  endAdornment: (
                    <InputAdornment position="end">
                      <IconButton onClick={handleClickShowPassword}>
                        {showPassword ? <VisibilityOff /> : <Visibility />}
                      </IconButton>
                    </InputAdornment>
                  )
                }}
              />
  
              {error && <Error>{error}</Error>}
  
              <LoginButton variant="contained" onClick={loginUser}>
                Login
              </LoginButton>
              <Text style={{ textAlign: 'center' }}>OR</Text>
              <SignupButton onClick={toggleSignup} style={{ marginBottom: 50 }}>
                Create an account
              </SignupButton>
            </Wrapper>
          ) : (
            <Wrapper>
              <TextField
                variant="standard"
                value={signup.name}
                onChange={onSignupInputChange}
                name='name'
                label='Enter Name'
              />
              <TextField
                variant="standard"
                value={signup.username}
                onChange={onSignupInputChange}
                name='username'
                label='Enter Username'
              />
              <TextField
                variant="standard"
                value={signup.password}
                onChange={onSignupInputChange}
                name='password'
                label='Enter Password'
                type={showPassword ? 'text' : 'password'}
                InputProps={{
                  endAdornment: (
                    <InputAdornment position="end">
                      <IconButton onClick={handleClickShowPassword}>
                        {showPassword ? <VisibilityOff /> : <Visibility />}
                      </IconButton>
                    </InputAdornment>
                  )
                }}
              />
  
              {error && <Error>{error}</Error>}
              {success && <Success>{success}</Success>}
  
              <SignupButton onClick={signupUser}>
                Signup
              </SignupButton>
              <Text style={{ textAlign: 'center' }}>OR</Text>
              <LoginButton variant="contained" onClick={toggleSignup}>
                Already have an account
              </LoginButton>
            </Wrapper>
          )}
        </Box>
      </Component>
    );
  };
  
  export default Login;
